window.bookSummaryJSON = "<p><b>Not every love story begins in the light... </b></p> <p><b>Sometimes, the prince isn't charming. </b></p> <p><b>The damsel causes more distress than she's in. </b></p> <p><b>Sometimes, the danger doesn't come from a magic spell. </b></p> <p><b>It comes from each other. </b></p> <p><b>Welcome to dark romance. </b></p> <p><i>Damiano De Luca</i> by Parker S. Huntington </p> <p>A star-crossed mafia couple, forced apart 10 years ago, reunite at a funeral. And as sparks and danger fly between them, it may not be the last one... </p> <p><i>Rivalry: Slay One</i> by Laurelin Paige </p> <p>He was her father's most vicious enemy before she put his ring on her finger. Now he's hers. Never bet on a game you aren't guaranteed to win...</p> <p><i>Rough Edge</i> by CD Reiss </p> <p>She thought she knew her husband, but the man he is becoming is a cruel stranger. Worse than that? She's starting to fall for his new, terrifying personality... </p> <p><i>Better When It Hurts</i> by Skye Warren </p> <p>Once, he was her foster brother. Now, he's the man who's sworn to avenge her betrayal - if only he can fight his growing attraction first.</p>"; 
